Resource.create([archetype_id: (Archetype.find_by name: 'scopeNote').id, literal: "Formed 1965, from Chagos Archipelago (formerly part of Mauritius) and Aldabra, Desroches and Farquhar Islands.  The latter three islands were ceded to Seychelles when it attained independence in 1976.  The Chagos Archipelago, which continued to be administered by Mauritius until 1976, thus remains the sole territory comprising the British Indian Ocean Territory. For texts dealing with jurisdiction, use CHAGOS ARCHIPELAGO.", language_id: (Language.find_by name: 'en').id])
Resource.create([archetype_id: (Archetype.find_by name: 'scopeNote').id, literal: "Образована в 1965 г. из архипелага Чагос (ранее часть Маврикия) и островов Альдабра, Дерош и Фаркуар. Последние три острова были в 1976 г. уступлены Сейшельским Островам, когда те получили независимость. Таким образом, архипелаг Чагос, который до 1976 г. управлялся совместно с Маврикием, остается единственной территорией в составе Британской территории в Индийском океане. Применительно к текстам, касающимся юрисдикции, использовать термин «CHAGOS ARCHIPELAGO»", language_id: (Language.find_by name: 'ru').id])
